import React from 'react';

const index = () => {
    return (
        <tr>
                  <td>1</td>
                  <td>tai@gmail.com</td>
                  <td>123</td>
                  <td>Active</td>
                  <td>Admin</td>
                  <td>
                    <button className="btn shadow-none fas fa-trash"></button>
                    <button className="btn shadow-none fas fa-edit"></button>
                  </td>
                </tr>
    );
}

export default index;
